import React, { useState } from "react";
import "./News.css";

// Composant pour afficher un article de news

const NewsArticle = ({ article }) => {
  // Fonction pour gérer les clics sur le lien externe
  const handleExternalLinkClick = () => {
    const confirmation = window.confirm(
      "Ce lien vous redirigera vers un site externe. Souhaitez-vous continuer ?"
    );

    if (confirmation) {
      // Ouvrir l'URL de l'article dans un nouvel onglet
      window.open(article.url, "_blank");
    }
  };

  return (
    <div className="news-article">
      <img src={article.image} alt={article.title} className="article-image" />
      <h3>{article.title}</h3>
      <p>{article.description}</p>
      <button className="article-link" onClick={handleExternalLinkClick}>
        Lire plus (Lien externe)
      </button>
    </div>
  );
};



